import axios from 'axios';
import { useState } from 'react';
import { useLocation } from 'react-router-dom';
import '../style/Boardcreate.css';

const Boardcreate = () => {

    const location = useLocation();
    const isLogin = location.state?.isLogin;
    const whoLogin = location.state?.whoLogin;
    const timestring = location.state?.timestring;
    const timestring2 = location.state?.timestring2;

    return (
        <>
            <div className='boardcreate-outer boardcreate-section'>
                <div className='boardcreate-inner boardcreate-section'>
                    <div className='boardcreate-boardcreateform'>

                        <div className='boardcreate-sidemenu'>

                            <div className='boardcreate-sidemenu-title'>
                                <h1>글 쓰기</h1>

                                {isLogin ? 
                                    <h2>{whoLogin}</h2>
                                :
                                    <h2>익명(비로그인)</h2>
                                }

                                <h3>{timestring}</h3>

                                <h3>{timestring2}</h3>

                            </div>

                            <div className='boardcreate-sidemenu-menubar'>

                                <div className='boardcreate-sidemenu-writemenu boardcreate-section'>
                                    <button className='boardcreate-sidemenu-writebtu'>글 작성</button>
                                </div>

                            </div>

                        </div>

                        <div className='boardcreate-contents boardcreate-section'>


                            <div className='boardcreate-contents-boardcreate'>

                                <div className='boardcreate-contents-boardcreatedes'>
                                    <></>
                                </div>


                            </div>
                        </div>

                    </div>
                </div>
            </div>
        </>
    )
}

export default Boardcreate;
